import React from "react";
import {Box, Flex, Text, Heading} from "rebass";

export default class Home extends React.Component {
    render () {
        return (
            <Box>
                <Heading>Neel is dumb</Heading>
                <Text>HI</Text>
            </Box>
        )
    }
}
